"use strict";

import ActionTypes from "./action_types";
import Dispatcher from "./dispatcher";
import APIController from "./api_calls";

const Actions = {
  getSports() {
    Dispatcher.handleViewAction({
      actionTypes: ActionTypes.GET_SPORTS,
    });
    APIController();
  },
};

export default Actions;
